import{_ as t,c as o,o as n,ah as r}from"./chunks/framework.PvdZnrZd.js";const h=JSON.parse('{"title":"PRINT-ON-DEMAND - DYNAMIC MOCKUPS","description":"PRINT-ON-DEMAND - DYNAMIC MOCKUPS","frontmatter":{"title":"PRINT-ON-DEMAND - DYNAMIC MOCKUPS","description":"PRINT-ON-DEMAND - DYNAMIC MOCKUPS","date":"2025-05-11T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/Dynamic Mockups/PRINT-ON-DEMAND - DYNAMIC MOCKUPS.md","filePath":"zenith/Dynamic Mockups/PRINT-ON-DEMAND - DYNAMIC MOCKUPS.md"}'),a={name:"zenith/Dynamic Mockups/PRINT-ON-DEMAND - DYNAMIC MOCKUPS.md"};function s(i,e,c,d,l,p){return n(),o("div",null,[...e[0]||(e[0]=[r('<p>In today’s e-commerce world, <strong>print-on-demand products</strong> are gaining significant popularity as customers increasingly seek personalized and unique items.</p><p>The ability to create and sell custom-designed products helps vendors meet customer needs and stand out in the market.</p><p>The <a href="https://store.webkul.com/Shopify-Multi-Vendor-Marketplace.html" target="_blank" rel="noreferrer">Webkul Multivendor Marketplace App</a>&#39;s integration with <strong>Print-On-Demand Products: Dynamic Mockups</strong> makes selling personalized products more efficient and seamless than ever.</p><p><a href="https://dynamicmockups.com/" target="_blank" rel="noreferrer">Dynamic mockups</a> allow sellers to add custom designs to products like T-shirts, mugs, or phone cases. These mockups give a realistic preview of how the product will look with the seller’s design.</p><p>By integrating this with the Webkul Multivendor Marketplace, sellers can easily manage and showcase their custom products, providing a smooth experience for customers.</p><h3 id="features" tabindex="-1">Features <a class="header-anchor" href="#features" aria-label="Permalink to &quot;Features&quot;">​</a></h3><p><strong>Editing</strong>: You can easily modify images by adjusting colors, selecting print areas, and transforming perspectives.</p><p><strong>Automated Editing</strong>: All changes are automatically applied, allowing you to view the final result instantly.</p><p><strong>Real-Time Changes</strong>: See image adjustments in real-time as you make them.</p><h3 id="getting-started-with-the-dynamic-mockup-print-on-demand" tabindex="-1">Getting Started with the Dynamic Mockup Print-on-Demand <a class="header-anchor" href="#getting-started-with-the-dynamic-mockup-print-on-demand" aria-label="Permalink to &quot;Getting Started with the Dynamic Mockup Print-on-Demand&quot;">​</a></h3><p>To enable the Print on Demand - Dynamic Mockup feature, go to the <strong>Multivendor Marketplace App Admin Panel</strong>.</p><p>Hover over the three dots (...), select <strong>Featured Apps</strong>, then search for <strong>Print on Demand - Dynamic Mockups</strong> and click <strong>Enable</strong>.</p><p><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXe_6yNRfVbbr-RivDD5i4nDuMjxzoswLwHqr456ATFzgzDlEhCAklN44P9TzQhsRuFUhF2m6CpuY6QM2QkAUOTkovft3cMC8XKR7aTUj_JKU6NULE7k7bSb-1ivzD55NswRkEi7KQ?key=FAR3e2gzSix_B3TCfXrjQg" alt="Print-On-Demand Products:"></p><p>Once you enable this featured app, you need to approve the charges for the app i.e. $10 per month.</p><h3 id="admin-end-configuration" tabindex="-1">Admin end Configuration <a class="header-anchor" href="#admin-end-configuration" aria-label="Permalink to &quot;Admin end Configuration&quot;">​</a></h3><p>Once the charges are approved, the admin must configure the settings by navigating to <strong>Multivendor Marketplace Admin Panel &gt; Configuration &gt; Print-on-Demand - Dynamic Mockups Configuration</strong>.</p><p>In this section, the admin will add the API keys for both the admin and the seller to enable the Dynamic Mockup dashboard.</p><p><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXf-YTtH7-VKmysVm-h1QYAdWXuw3Gew4AcdKpyqQnJ1Gex5Ilip50yrM3uZYMUdxnVFeLAWt_zR2l4Xvzs-_B-uzmqW1FzYbG5UlDMsrtm508Pt36reDtCsqrC1weu7FZQy8gYP?key=FAR3e2gzSix_B3TCfXrjQg" alt="Print-on-demand: Dynamic Mockups"></p><p>To obtain the API keys, the admin can click on <strong>&quot;By Dynamic Mockups&quot;</strong> to create an account on the Dynamic Mockup platform and gain access to the dashboard.</p><p><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXeKmrfqbm-us3yJZ8ED9S6iHegH8rNs_Y3MY32Hdcop2WeNT-_sLWw5g-YH2OZvs1k1Jmsdd5XfVMF9bRCr86tU2ZS5ViAm-XW9IcOTpCLltK8ORymYJvi6_QGpuHUgEFRn66AKPg?key=FAR3e2gzSix_B3TCfXrjQg" alt="Print-on-demand: Dynamic Mockups"></p><h3 id="create-an-account-on-dynamic-mockups" tabindex="-1">Create an Account on Dynamic Mockups <a class="header-anchor" href="#create-an-account-on-dynamic-mockups" aria-label="Permalink to &quot;Create an Account on Dynamic Mockups&quot;">​</a></h3><p>To create an account, click on <strong>Sign Up</strong>. If you already have an account on <a href="https://dynamicmockups.com/" target="_blank" rel="noreferrer">Dynamic Mockups</a>, you can log in with your existing credentials or choose to log in or sign up using your Google account.</p><p><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXegImytq5XSfwBAsIHNOGMJAgK96GSRLdlNtNvMhS2kmPyWyEXJGvrOxB0ZwdC3Z_xfYnf2dqFq7EEng20FCFVRJZI_OTge8lqqi9OS04Kwqze4u6G-jJ75R3hWrVe9bK_6sX17gA?key=FAR3e2gzSix_B3TCfXrjQg" alt="Print-on-demand: Dynamic Mockups"></p><p><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXdbwHb_7h0YdodBk4UrAXwTldrFZbOliAm6vgd2GQe6btLUDzbnmBKRo3HQogeoA4VqEHc96TwwhoSW9L90xjK0GHfQWTi0ll475LSa8dIE7miU8c6ppOJyw0N0YEOAIK4EF_s_pA?key=FAR3e2gzSix_B3TCfXrjQg" alt="Print-on-demand: Dynamic Mockups"></p><h3 id="for-admin-embeddable-mockup-editor-website-key" tabindex="-1"><strong>For Admin Embeddable Mockup Editor Website Key</strong> <a class="header-anchor" href="#for-admin-embeddable-mockup-editor-website-key" aria-label="Permalink to &quot;**For Admin Embeddable Mockup Editor Website Key**&quot;">​</a></h3><p>Once you have created or logged into your account and filled in all the basic details, click on <strong>&#39;Embed Mockup Editor&#39;</strong> and then select <strong>&#39;Create New Website Key&#39;</strong>.</p><p><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXeEVlSM21YDrBFpTYXZCotzO82lQgUv7b5VjkgA-y-26k6nm9oZIPwSEHgKPHHI4TDCZAtwdVhfZpdAgtPUjUmPIYAvQ92_mhpl-PMcJJCSBN7acdpRqnpxt1Vc4frVXDbvU7tAtg?key=FAR3e2gzSix_B3TCfXrjQg" alt="Print-on-demand: Dynamic Mockups"></p><p>Clicking on &#39;Create New Website Key&#39; will prompt you to enter your website name and the whitelisted domain (<a href="https://sp-seller.webkul.com/" target="_blank" rel="noreferrer">https://sp-seller.webkul.com/</a>). Then, click &#39;Create&#39; to generate your API keys.</p><p><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXea3Ixd5cNB8mib-8EvMOcYWFiTjBAkdF9zCdNmIhXfS_FiD42gVoF5ZjK_MY0-DVlVImfAyxxY73-p9pVo5EPtK1DU-BHFvXhGbkxiMoE_pUZjH1nnLGFkgTspFeWEDTZMEnwx?key=FAR3e2gzSix_B3TCfXrjQg" alt="Print-on-demand: Dynamic Mockups"></p><h3 id="for-seller-embeddable-mockup-editor-website-key" tabindex="-1"><strong>For Seller Embeddable Mockup Editor Website Key</strong> <a class="header-anchor" href="#for-seller-embeddable-mockup-editor-website-key" aria-label="Permalink to &quot;**For Seller Embeddable Mockup Editor Website Key**&quot;">​</a></h3><p>To generate the <strong>Seller API Key</strong>, follow the same process as for the Admin. Click on <strong>&#39;Create New Website Key&#39;</strong>, enter your website name, and proceed to the whitelisted domain section.</p><p>In the whitelisted domain section, enter your <strong>seller URL</strong> from the <strong>Multivendor Marketplace App</strong>. Finally, click <strong>&#39;Create&#39;</strong> to generate your API keys.</p><p><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXe25_VGKglJrtu-P7CuxCgXww_4_cQT8uiDdkrGQZq7M6LMfAVjl4eSehtyYUJY51bqqeBxF0WxbWOqrYvrW0o0sz74VbMVlwyWuYwhm4iy-e2gC6TAfz_UBy6N-d2GM7PHaF2q?key=FAR3e2gzSix_B3TCfXrjQg" alt="Print-on-demand: Dynamic Mockups"></p><p>After generating the API keys for both Admin and Seller, copy the website key and enter it into the Configuration section.</p><p><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXfWF-vIPBtLHbaYxVRky1JpBYgioE8bk0NuNc2MqhM4vTS9XY88pIr3xZMErxsqWgItwxUvCTOdCQefbn2M_l45qlZW3Rz-sqcN7ncSiK2Q-MaVSMLsmw2vGCnoXToNk1KCG8VY?key=FAR3e2gzSix_B3TCfXrjQg" alt="Print-on-demand: Dynamic Mockups"></p><p>Once you (Admin) register yourself on the Dynamic Mockups platform, you can add mockups like T-shirts, mugs, pillows, etc., where you want to print your design.</p><p><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXfisVD3RDkWKvluYGo7zj-27iamW07n3TOHqJJii44v78UksKydibUQ_CXWH2zGoKs8jXAC1fd1r82nbXJE0U7wKZf4BodLR1ga1XqpxPE7Si8aR2AldQmZcdMHXboAHfAqNtoJ?key=FAR3e2gzSix_B3TCfXrjQg" alt="Print-on-demand: Dynamic Mockups"></p><h3 id="seller-panel" tabindex="-1">Seller Panel <a class="header-anchor" href="#seller-panel" aria-label="Permalink to &quot;Seller Panel&quot;">​</a></h3><p>Once the Admin sets the mockups, the Seller can use the <strong>Dynamic Mockups</strong> feature while adding their product.</p><p>The Seller needs to check the box <strong>&#39;TO ADD PRINT-ON-DEMAND PRODUCT - DYNAMIC MOCKUPS&#39;</strong> on the product form page.</p><p>When this checkbox is selected, the option <strong>&#39;Image add by POD&#39;</strong> becomes available on the product form page.</p><p><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXd_cZvDe9CPLRZqt9MaGclhRn8bTxImKHUwVReHU4fzGVgpY2x-9MDEPZjaUUS1vX4jm6G8NEFL_eEMIW36H0i8Dkr0YhT7Oc7kgZnZCj4OUFhT0lpioP9QJ9kybxDHrnfLwkHKcw?key=FAR3e2gzSix_B3TCfXrjQg" alt="Print-on-demand: "></p><p>When the seller clicks on <strong>&#39;Add Images by POD&#39;</strong>, the <strong>Print-On-Demand Products: Dynamic Mockups</strong> screen appears.</p><p><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXdXguOm7Q_hbqJ7OYFOfs_v2RsgQyU4jlJ65fNIEuGByulfHYd71VZY2TMwQjWIK1-EZ-6cMPQhqeh3e0SmG7cicGuXHCnatiSzrcKlNP2f3ZUJ2qrBcmY3HBGXDLjd-C199LtR?key=FAR3e2gzSix_B3TCfXrjQg" alt="Print-on-demand: Dynamic Mockups"></p><p>From there, the seller can select a product that the Admin has already added, upload their design, and adjust its placement on the product.</p><p>They can preview how the design will look in real-time and also change the product&#39;s color as needed.</p><p><strong>Note:</strong> A maximum of 10 images can be added.</p><p><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXcIYVW5rASRnc_qtn3twUyXS6HYOuNQcHX2HLtHm929acmW7GOO7OTivgPV3NZ2E6liwfYmxmWblCjqsrpLrUZkVRWZ9iCi5nApa0GrgHKqA7k2vtbn4SpK4I4T7EwNvrYf0pWblQ?key=FAR3e2gzSix_B3TCfXrjQg" alt="Print-on-demand: "></p><p>The seller can click on the <strong>plus (+) icon</strong> to add their design for printing on the product and use the <strong>color option</strong> to change the product&#39;s color.</p><p><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXenZW4aKlfOyN-E5DkMuyO4ZL89PkQ2lq8962UfAftvbQNbXj2SbbnHC6HnwJTnSbQ9Ny0yus0OHs3yftPPeTGeY_yfbtHquU_jJmHYmIfSe5bTtNQ7GT1uHLh3F_Db2IVeCK8Ntw?key=FAR3e2gzSix_B3TCfXrjQg" alt="Print-on-demand: Dynamic Mockups"></p><p>Adjust the design on the product to your desired position, then click on the <strong>&#39;Export Mockups&#39;</strong> tab to export the design.</p><p>Afterward, the seller can fill in all the product details on the product form page and click <strong>&#39;Save&#39;</strong> to complete the process.</p><p><strong>Note:</strong> Once a product is marked as <strong>POD</strong>, it cannot be unchecked again.</p><p>When the seller adds the product, it will appear in the <strong>Product Listing</strong> section of the seller panel.</p><p><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXcLinzOSA9FjK6jweNsAOBWgRtvpqgOB89gHpyMheJe2Z5apjr4j8D0y2CLgwYqeYDAI3JsbixvHCVXk6Q_0TfGsdTnQ84oupHgRHDWz4LE3ILhEuvNFlqKTrx-vQx5ReSmfP7z?key=FAR3e2gzSix_B3TCfXrjQg" alt="Print-on-demand: "></p><h3 id="frontend" tabindex="-1">Frontend <a class="header-anchor" href="#frontend" aria-label="Permalink to &quot;Frontend&quot;">​</a></h3><p>The product will appear in the store, allowing customers to view and purchase it.</p><p><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXdi527tRx-58Kxzyv-B6HzdjEyUAtzlE8JKTZYGlwb5gvwb7S8ajdUCOYdDV233QgmtkqQKHI1VE_sSuvXLQ7SEHYMZnuuU0dMA5HvlpL31IiKkO9j5wa05P9ekBckLFdq2dFUMjQ?key=FAR3e2gzSix_B3TCfXrjQg" alt="Print-On-Demand Products:"></p><p>This was all about the <strong>Print-On-Demand Products: Dynamic Mockups</strong> featured App for the <strong>Multivendor Marketplace</strong> for <strong>Shopify</strong>.</p>',59)])])}const m=t(a,[["render",s]]);export{h as __pageData,m as default};
